    var myAdmin = {
        adminInit: function () {
            $(".menu-level-2").hide();
            myAdmin.CheckSub();
            myAdmin.EventListener();
        },

        CheckSub: function () {
            var data = $(".admin-sub").height();
            if (data > 0) {
                $("#wrapper-admin").css('z-index', '0');
            } else {
                $("#wrapper-admin").css('z-index', '-9');
            }
        },


        EventListener: function () {
            $(".iconuser").click(function () {
                $(".admin-sub").slideToggle();
                myAdmin.CheckSub();
            });

            $(".iconNotifi").click(function () {
                $(".admin-noti").slideToggle();
                myAdmin.CheckSub();
            });

            $("#sider-icon-full").click(function () {
                if ($(".navbar-wrapper").height() > 60) {
                    $(".navbar-wrapper").animate({ height: 60 }, "fast");
                    $(".cssmenu").hide();
                    $("#wrapper-admin").animate({ right: "2%" }, "slow");
                    $("#wrapper-admin").animate({ width: "95%" }, "slow");
                } else {
                    $("#wrapper-admin").animate({ right: "1%" }, "fast");
                    $("#wrapper-admin").animate({ width: "77%" }, "fast");
                    $(".navbar-wrapper").animate({ height: "100vh" }, "slow");
                    $(".cssmenu").show();

                }
            });

        },

        OnClickMenu: function () {
            $(".menu-level-2").slideToggle();
        },

    };
    myAdmin.adminInit();

